import React, { Component } from 'react';
import Select from 'react-select';
import CMap from './CMap'

class RegisterDelivery extends Component {
	render() {
		return (
			<>
				<div>
					<div style={{float: "left"}}>
						<CMap
							healthState={new Map<0, 0>()}
							batteryState={new Map<0, 0>()}
						></CMap>
					</div>
					<div className="form-group" style={{float:"right", marginTop:"20px"}}>
						<label>Sender Name</label>
						<input
							type="text"
							className="form-control"
							name="client_name"
							placeholder={'Enter your name'}
							style={{marginBottom:"20px", width:"250px"}}
							//value={value.value_name}
							//onChange={this.handleValueChange(idx)}
						/>
						<label>Sender Phone Number</label>
						<input
							type="text"
							className="form-control"
							name="client_name"
							placeholder={'Enter your phone number'}
							style={{marginBottom:"20px"}}
							//value={value.value_name}
							//onChange={this.handleValueChange(idx)}
						/>
						<label>Recipient Name</label>
						<input
							type="text"
							className="form-control"
							name="client_name"
							placeholder={'Enter recipient name'}
							style={{marginBottom:"20px"}}
							//value={value.value_name}
							//onChange={this.handleValueChange(idx)}
						/>
						<label>Recipient Phone Number</label>
						<input
							type="text"
							className="form-control"
							name="client_name"
							placeholder={'Enter recipient phone numeber'}
							style={{marginBottom:"20px"}}
							//value={value.value_name}
							//onChange={this.handleValueChange(idx)}
						/>
						<label>Destination Tag</label>
							<Select
								className="basic-select"
								name="sink"
								// options={sinkOptions}
								classNamePrefix="select"
								// onChange={this.handleSinkChange}
							/>
					</div>
					<div>
						<button
							type="submit"
							className="btn my-2 my-sm-0" 
							// onClick={this.handleSubmit}
							style={{ background: '#82CAFA', color : 'white', marginTop:"5000px"}}
							>
							Register Delivery
						</button>
					</div>
				</div>
			</>
		);
	}
}

export default RegisterDelivery;
